import './App.css';


import React, { Component } from 'react'
import Navbar from './components/Navbar';
import News from './components/News';

import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
  Router,
  Routes,
} from "react-router-dom";


export default class App extends Component {
  name = "saket";
  render() {

    return (
      <div>
        <Router>
        <Navbar/>
        <Routes>
          <Route path=''><News pageSize = {5} category = "sports" country="in" /></Route>

        </Routes>
        </Router>
      </div>
    )
  }
}
